from random import randint
import copy, base64


class Dice:
    eyes = None

    def __init__(self):
        self.roll_dice()

    def roll_dice(self):
        self.eyes = randint(1, 6)

    def see_eyes(self):
        return self.eyes

    def __str__(self):
        return str(self.eyes)


class Kniffel:
    OldDices = None
    Dices = None
    times_thrown = 0

    def __init__(self):
        pass

    def __str__(self):
        return str(self.see_all_dices())

    def print_old(self):
        print(str(self.see_all_old_dices()))

    def start_new_round(self):
        self.OldDices = copy.deepcopy(self.Dices)
        self.Dices = [(Dice(), False) for _ in range(5)]  # tuple of (dice, keep?)
        self.times_thrown = 1

    def see_all_dices(self):
        if self.Dices is not None:
            return [D[0].see_eyes() for D in self.Dices]
        else:
            return [1 for _ in range(5)]

    def see_keeps(self):
        if self.Dices is not None:
            return [D[1] for D in self.Dices]
        else:
            return [False for _ in range(5)]

    def see_all_old_dices(self):
        if self.OldDices is not None:
            return [D[0].see_eyes() for D in self.OldDices]
        else:
            return [1 for _ in range(5)]

    def roll(self):
        if self.times_thrown < 3:
            for D in self.Dices:
                if not D[1]:
                    D[0].roll_dice()
            self.reset_keep()
            self.times_thrown += 1
        else:
            pass

    def keep(self, lst: list or int = None):
        if lst is []:
            pass
        else:
            if type(lst) is list:
                for n in lst:
                    self.Dices[n] = (self.Dices[n][0], True)
            else:
                self.Dices[lst] = (self.Dices[lst][0], True)
            self.change_oder(lst)

    def reset_keep(self):
        for n in range(5):
            self.Dices[n] = (self.Dices[n][0], False)

    def change_oder(self, lst: list or int):
        copy_of_dices = copy.deepcopy(self.Dices)
        dice_no = list(range(5))
        counter = 0
        if type(lst) is list:
            for n in lst:
                self.Dices[counter] = copy_of_dices[n]
                dice_no.remove(n)
                counter += 1
        else:
            self.Dices[counter] = copy_of_dices[lst]
            dice_no.remove(lst)
            counter += 1

        for rest in dice_no:
            self.Dices[counter] = copy_of_dices[rest]
            counter += 1


